      <ul>
        <li className="is-active">
          <NavLink to="#">Gloabal feed</NavLink>
        </li>
        <li>
          <NavLink to="#">Your feed</NavLink>
        </li>
        <li>
          <NavLink to="#" />
        </li>
      </ul>
    </div>
  );
}

export default Tabs;
